package db.domain;import java.util.Arrays;public class LogFindFighterImpl implements LogFindFighter {	@Key	private int logId;	private String uname;	private String nick;	private int fighterId;	private int time;	private int type;	public LogFindFighterImpl() {	}	public LogFindFighterImpl(LogFindFighter c) {		this.logId = c.getLogId();		this.uname = c.getUname();		this.nick = c.getNick();		this.fighterId = c.getFighterId();		this.time = c.getTime();		this.type = c.getType();	}	@Override	public String tableName() {		return "log_find_fighter";	}	public void setLogId(int logId) {		this.logId = logId;	}	public int getLogId() {		return this.logId;	}public void addLogId(int logId) {		this.logId += logId;}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setNick(String nick) {		this.nick = nick;	}	public String getNick() {		return this.nick;	}public void addNick(String nick) {		this.nick += nick;}	public void setFighterId(int fighterId) {		this.fighterId = fighterId;	}	public int getFighterId() {		return this.fighterId;	}public void addFighterId(int fighterId) {		this.fighterId += fighterId;}	public void setTime(int time) {		this.time = time;	}	public int getTime() {		return this.time;	}public void addTime(int time) {		this.time += time;}	public void setType(int type) {		this.type = type;	}	public int getType() {		return this.type;	}public void addType(int type) {		this.type += type;}}